import './App.css';
import Hw from './components/HW/Hw';
import Hw1 from './components/HW1/Hw1';
import Hw2 from './components/HW2/Hw2';
import Hw3 from './components/Hw3/Hw3';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route index element={<Hw/>}>
          <Route path='/hw1' element={<Hw1/>}/>
          <Route path='/hw2' element={<Hw2/>}/>
          <Route path='/hw3' element={<Hw3/>}/>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
